import React from "react";
import './signin.css'
const Signin = () => {
    return(
        <>
        <center>
           <div style={{height:500,width:400,backgroundColor:"white",marginTop:50,borderRadius:12}}>
             <span style={{display: "inline-block",marginTop:20,color:"red",}}>SIGN IN</span> 
             {/* span tag me margintop(vertical) nahi chalta to uske liye hum display ko inline block kiya hai.span tag inline element hai isliye horizontal(-)me hi chalta hai  */}
           </div>
           </center>  
        </>
    )

}

export default Signin;
